import React from 'react'
import { Route } from 'react-router-dom'
import Login from '../screens/Login'
import home from '../screens/Home'

const App = () => {
  return (
    <div className="App">
      <Route path='/' exact component={Login}/>
      <Route path='/home' component={Home}/>
    </div>
  )
}

export default App
